  profiles from XBT casts from the MINNETONKA and other platforms from Ocean Weather
  Station N (OWS-N) in the North Pacific Ocean in support of the International Decade
  of Ocean Exploration (IDOE) from 1971-08-02 to 1973-04-11 (NODC Accession 7300488)\",\n\t\"tracking_summary\":
