  [],\n\t\"revision_timestamp\": \"2016-10-03T22:06:54.484151\",\n\t\"name\": \"temperature-profiles-from-xbt-casts-from-the-minnetonka-and-other-platforms-from-ocean-weather-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bathythermograph data were collected from
  the MINNETONKA within a 1-mile radius of Ocean Weather Station N (3000N 14000W)
  and in transit from 02 August 1971 to 11 April 1973. Data were collected by the
  United States Coast Guard (USCG) and the University of Washington (UW) in support
  of the International Decade of Ocean Exploration (IDOE). Data were processed by
  NODC to the NODC standard Universal Bathythermograph Output (UBT) format. Full BT
  descriptions are available at www.nodc.noaa.gov/General/NODC-Archive/bt.html.nnThe
  UBT format contains temperature-depth profile data obtained using expendable bathythermograph
  (XBT) instruments. Cruise information, position, date and time were reported for
  each observation. The data records are comprised of pairs of temperature-depth values.
  The XBT data files contain temperature values at non-uniform depths. These depths
  were recorded at the minimum number of points (\"inflection points\") required to
  accurately define the temperature curve.nStandard XBTs can obtain profiles to depths
  of either 450 or 760 m. Special instruments permit measurements to 1830 m.\",\n\t\"license_title\":
